import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on Electronics category to get to product listing page
    await page.waitForSelector('text=Electronics', { timeout: 5000 });
    await page.click('text=Electronics');

    // Wait for and take screenshot of category page
    await page.waitForSelector('.products-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category.png'));

    // Wait for sort dropdown and select price low to high
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for products to update and take final screenshot
    await page.waitForTimeout(2000); // Brief pause for UI update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_sorted.png'));

    // Extract price data to verify sorting
    const priceData = await page.$$eval('.product-price', prices => 
      prices.map(p => {
        const text = p.textContent.trim();
        const priceMatch = text.match(/\$\d+\.\d+/);
        return priceMatch ? parseFloat(priceMatch[0].replace('$', '')) : 0;
      })
    );

    return {
      success: true,
      action: "Applied price sort filter (low to high) on Electronics category",
      extractedData: {
        productCount: priceData.length,
        lowestPrice: priceData.length > 0 ? Math.min(...priceData) : 0,
        highestPrice: priceData.length > 0 ? Math.max(...priceData) : 0
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
